class Solution {
  int maxNumberOfAlloys(int n, int k, int budget, List<List<int>> composition, List<int> stock, List<int> cost) {
    int maxAlloys = 0;
    for (int machine = 0; machine < k; machine++) {
      int totalCost = 0;
      int maxPossibleAlloys = budget + 1;
      for (int metal = 0; metal < n; metal++) {
        int requiredMetal = composition[machine][metal] * maxPossibleAlloys;
        int metalToBuy = requiredMetal > stock[metal] ? requiredMetal - stock[metal] : 0;
        totalCost += metalToBuy * cost[metal];
        while (totalCost > budget && maxPossibleAlloys > 0) {
          maxPossibleAlloys--;
          totalCost = 0;
          for (int j = 0; j < n; j++) {
            requiredMetal = composition[machine][j] * maxPossibleAlloys;
            metalToBuy = requiredMetal > stock[j] ? requiredMetal - stock[j] : 0;
            totalCost += metalToBuy * cost[j];
          }
        }
      }
      if (maxPossibleAlloys > maxAlloys) {
        maxAlloys = maxPossibleAlloys;
      }
    }
    return maxAlloys;
  }
}
